                  network = new vis.Network(container, data, options);

                  

                  

                  


                  
                      network.on("stabilizationProgress", function(params) {
                          document.getElementById('loadingBar').removeAttribute("style");
                          var maxWidth = 496;
                          var minWidth = 20;
                          var widthFactor = params.iterations/params.total;
                          var width = Math.max(minWidth,maxWidth * widthFactor);
                          document.getElementById('bar').style.width = width + 'px';
                          document.getElementById('text').innerHTML = Math.round(widthFactor*100) + '%';
                      });
                      network.once("stabilizationIterationsDone", function() {
                          document.getElementById('text').innerHTML = '100%';
                          document.getElementById('bar').style.width = '496px';
                          document.getElementById('loadingBar').style.opacity = 0;
                          // really clean the dom element
                          setTimeout(function () {document.getElementById('loadingBar').style.display = 'none';}, 500);
                      });
                  

                  return network;

              }
              drawGraph();
        </script>
         </script>

 <div id="searchContainer" style="position: fixed; top: 10px; left: 10px; background: white; padding: 10px; border: 1px solid #ccc; z-index:9999;">
     <input type="text" id="searchInput" placeholder="Enter node label" style="font-size:16px;"/>
     <button onclick="searchNode()" style="font-size:16px;">Go</button>
   </div>
   
   <script type="text/javascript">
       function searchNode(){
           // Get the node label entered by the user
           var nodeLabel = document.getElementById("searchInput").value.trim();
           if(!nodeLabel){
               alert("Please enter a node label.");
               return;
           }
           
           // Retrieve all nodes from the vis.js data - assumes "nodes" is defined as in your existing code
           var allNodes = nodes.get({ returnType: "Object" });
           var targetId = null;
           
           // Iterate through the nodes to find one with a matching label (case-insensitive)
           for (var id in allNodes) {
               if (allNodes[id].label && allNodes[id].label.toLowerCase() === nodeLabel.toLowerCase()){
                   targetId = allNodes[id].id;
                   break;
               }
           }
           
           if (targetId !== null) {
               // Use vis.js built-in focus method to pan & zoom to the node
               network.focus(targetId, {
                   scale: 1.5,
                   animation: {
                       duration: 1000,
                       easingFunction: "easeInOutQuad"
                   }
               });
           } else {
               alert("Node '" + nodeLabel + "' not found.");
           }
       }
   </script>
